import React from "react";

import { Props } from "./types";
import * as Styled from "./style";

const Banner = ({}: Props) => {
  return (
    <Styled.MainBanner>

      <Styled.Title fontSize={[30, 20, 10]} >
        Funk explode em
        <Styled.SubTitle>
          conteúdos exclusivos?
        </Styled.SubTitle>
      </Styled.Title>

      <Styled.Description fontSize={[30, 20, 10]} >
        Já pensou?! Ter acesso a músicas e videoclipes 
        exclusivos do: MC Luan da BS, MC L Da Vinte,
        MC Kaio e cia.?
      </Styled.Description>

      <Styled.BtnTitle fontSize={[30, 20, 10]} >
        Então, se <BtnTitleGlow>inscreve</BtnTitleGlow> aí
      </Styled.BtnTitle>

      <Styled.Btn fontSize={[30, 20, 10]} >Titulo da pagina</Styled.Btn>

    </Styled.MainBanner>
  )
};

export default Banner;
